import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Paper,
  List,
  ListItem,
  ListItemText,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Rating,
  Box,
  Chip,
  Grid,
} from '@mui/material';
import axios from 'axios';

interface Review {
  id: number;
  title: string;
  status: string;
  analyst: string;
  created_at: string;
}

interface ReviewDetail {
  id: number;
  title: string;
  description: string;
  code: string;
  comments: Array<{
    user: string;
    text: string;
    timestamp: string;
  }>;
  suggested_modifications: Array<{
    line: number;
    text: string;
    suggestion: string;
  }>;
}

const Review: React.FC = () => {
  const [reviews, setReviews] = useState<Review[]>([]);
  const [selectedReview, setSelectedReview] = useState<ReviewDetail | null>(null);
  const [dialogOpen, setDialogOpen] = useState(false);
  const [comment, setComment] = useState('');
  const [rating, setRating] = useState<number | null>(null);

  useEffect(() => {
    fetchReviews();
  }, []);

  const fetchReviews = async () => {
    try {
      const response = await axios.get('/api/review/list');
      setReviews(response.data);
    } catch (error) {
      console.error('Error fetching reviews:', error);
    }
  };

  const handleReviewClick = async (reviewId: number) => {
    try {
      const response = await axios.get(`/api/review/${reviewId}`);
      setSelectedReview(response.data);
      setDialogOpen(true);
    } catch (error) {
      console.error('Error fetching review details:', error);
    }
  };

  const handleSubmitReview = async () => {
    if (!selectedReview || !comment || !rating) return;

    try {
      await axios.post(`/api/review/${selectedReview.id}/submit`, {
        comment,
        rating,
      });
      setDialogOpen(false);
      fetchReviews();
    } catch (error) {
      console.error('Error submitting review:', error);
    }
  };

  return (
    <Container maxWidth="lg">
      <Typography variant="h4" gutterBottom>
        Code Reviews
      </Typography>

      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <Paper>
            <List>
              {reviews.map((review) => (
                <ListItem
                  key={review.id}
                  button
                  onClick={() => handleReviewClick(review.id)}
                >
                  <ListItemText
                    primary={review.title}
                    secondary={
                      <>
                        <Typography component="span" variant="body2">
                          By {review.analyst} â€¢ {new Date(review.created_at).toLocaleDateString()}
                        </Typography>
                        <Chip
                          label={review.status}
                          color={
                            review.status === 'pending'
                              ? 'warning'
                              : review.status === 'approved'
                              ? 'success'
                              : 'error'
                          }
                          size="small"
                          sx={{ ml: 1 }}
                        />
                      </>
                    }
                  />
                </ListItem>
              ))}
            </List>
          </Paper>
        </Grid>
      </Grid>

      <Dialog
        open={dialogOpen}
        onClose={() => setDialogOpen(false)}
        maxWidth="md"
        fullWidth
      >
        {selectedReview && (
          <>
            <DialogTitle>{selectedReview.title}</DialogTitle>
            <DialogContent>
              <Typography variant="subtitle1" gutterBottom>
                Description
              </Typography>
              <Typography variant="body2" paragraph>
                {selectedReview.description}
              </Typography>

              <Typography variant="subtitle1" gutterBottom>
                Code
              </Typography>
              <Paper sx={{ p: 2, mb: 2, bgcolor: '#f5f5f5' }}>
                <pre>
                  <code>{selectedReview.code}</code>
                </pre>
              </Paper>

              <Typography variant="subtitle1" gutterBottom>
                Comments
              </Typography>
              <List>
                {selectedReview.comments.map((comment, index) => (
                  <ListItem key={index}>
                    <ListItemText
                      primary={comment.text}
                      secondary={`${comment.user} â€¢ ${new Date(
                        comment.timestamp
                      ).toLocaleString()}`}
                    />
                  </ListItem>
                ))}
              </List>

              <Box sx={{ mt: 2 }}>
                <Typography component="legend">Rating</Typography>
                <Rating
                  value={rating}
                  onChange={(event, newValue) => {
                    setRating(newValue);
                  }}
                />
              </Box>

              <TextField
                fullWidth
                multiline
                rows={4}
                variant="outlined"
                label="Add a comment"
                value={comment}
                onChange={(e) => setComment(e.target.value)}
                sx={{ mt: 2 }}
              />
            </DialogContent>
            <DialogActions>
              <Button onClick={() => setDialogOpen(false)}>Cancel</Button>
              <Button
                onClick={handleSubmitReview}
                variant="contained"
                color="primary"
                disabled={!comment || !rating}
              >
                Submit Review
              </Button>
            </DialogActions>
          </>
        )}
      </Dialog>
    </Container>
  );
};

export default Review;
